import { NavLink } from 'react-router-dom';

const DialogItem = ({ name, id }) => {
    let path = "/dialogs/" + id;

    return (
        <div className={s.dialog + ' ' + s.active}>
            <NavLink to={path}>{name}</NavLink>
        </div>
    )

